import React from "react";

function Conditional(props) {
    return (
        <div>
            <h1>Navbar</h1>
            {props.isLoading === true ? <h1>Loading...</h1> : <h1>Some cool stuff about conditional endering</h1>}
            <h1>Footer</h1>
        </div>  
    )

}

export default Conditional
